import './VidaYMinisterio.css';

function VidaYMinisterio() {


    function showNotification({top = 0, right = 0, className, html}) {

        let notification = document.createElement('div');
        notification.className = "notification";
        if (className) {
          notification.classList.add(className);
        }
    
        notification.style.top = top + 'px';
        notification.style.right = right + 'px';
    
        notification.innerHTML = html;
        document.body.append(notification);
    }
    
    showNotification({
        top: 10,
        right: 10,
        html: "<a href='Anuncios.html'>Nuevo anuncio</a>",
        className: "welcome"
    });
  


  return (
    <div className="VidaYMinisterio">
    <div class="sidebar" id="sidebar">
        <ul>
            <hr/>
            <li><a href="index.html">INICIO</a></li>
            <hr/>
            <li><a href="SalidasPredicacion.html">SALIDAS DE PREDICACION</a></li>
            <hr/>
            <li><a href="NoVisitar.html">NO VISITAR</a></li>
            <hr/>
            <li><a href="Territorios.html">TERRITORIOS</a></li>
            <hr/>
            <li><a href="VidaYMinisterio.html">VIDA Y MINISTERIO</a></li>
            <hr/>
            <li><a href="Anuncios.html">ANUNCIOS</a></li>
            <hr/>
        </ul>
    </div>
    <script src="index.js"></script> 

    <div class="content">
        <button class="toggle-btn" onclick="toggleSidebar()"><img src="img territorios/menu2.png"/></button>

    <hr/>
    <h1>Programa de la reunion vida y ministerio </h1>
    <hr/>
    <br/>
    <img src="img territorios/VM.png" width="600"/>
    </div>
    </div>

  );
  
}

export default VidaYMinisterio;
